syntax = "proto3";

package sdc.biceps;

option java_multiple_files = true;
option java_package = "org.somda.sdc.proto.model.biceps";
option java_outer_classname = "RetrievabilityMethodProto";


message RetrievabilityMethodMsg {
  enum EnumType {
    GET = 0;
    PER = 1;
    EP = 2;
    STRM = 3;
  }
  EnumType enum_value = 1;
}
